❗️Două treimi dintre români (65,2%) au sentimentul că România este în pericol, arată datele celui mai nou sondaj INSCOP.  

• 37,1% dintre români au declarat că au simțit pericolul „în foarte mare măsură”; 
• 28,1% „în mare măsură”; 
• 18,2% „în mică măsură”; 
• 15,3% „în foarte mică măsură” sau „deloc”; 
• 1,3% nu au știut sau nu au răspuns;

📎 Cei mai îngrijorați de viitorul țării sunt votanții USR și AUR, tinerii (18–29 ani) și locuitorii Bucureștiului. În schimb, votanții PNL și PSD, precum și locuitorii din urbanul mic sunt mai relaxați în percepția riscului. 
 
❓De unde vine pericolul? 
• 14,5% cred că amenințarea vine din afara țării; 
• 14,5% sunt de părere că problema este din interior; 
• 35,1% consideră că pericolul este mixt (din afară și din interior).

📎 Votanții PSD tind să creadă că amenințările sunt externe. Alegătorii AUR și angajații la stat consideră că pericolul este predominant intern. 
 
📃 Metodologie:
Barometru a fost realizat de INSCOP Research la comanda platformei Informat.ro în perioada 20–26 iunie 2025, pe un eșantion de 1.150 de persoane cu vârsta de 18 ani și peste, reprezentativ socio‑demografic pentru populația neinstituționalizată a României. 

Metoda folosită: CATI.  

Marja de eroare maxim acceptată este de ±2,9% la un grad de încredere de 95%. 

